import React from 'react';
import './Home.css';
import mateofabian from './images/mateofabian.jpeg';

function Home(){
    return(
        <div className="content">
            <div className="title">
                <h2>Mateo Jara Fabian</h2>
            </div>
            <div className="left-content">

                <p>Here picture!</p>
            </div>
            <div className="right-content">
                <p>Here description</p>
            </div>
            <div><image src={mateofabian} alt="mateo"/></div>
        </div>
    )
}

export default Home;
